import React from "react";

const Home = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <h1 id="h1">
        개발의 가치, <p></p>제가 실현해보겠습니다.
      </h1>
    </div>
  );
};

export default Home;
